// Merge combines two Addresses into one. The primary record will be kept, and the secondary will be deleted.
func MergeAddresses(exec boil.Executor, primaryID uint64, secondaryID uint64) (err error) {
	tx, ok := exec.(boil.Transactor)
	if !ok {
		txdb, ok := exec.(boil.Beginner)
		if !ok {
			return errors.Err("database does not support transactions")
		}

		tx, err = txdb.Begin()
		if err != nil {
			return errors.Err(err)
		}

		defer func() {
			if p := recover(); p != nil {
				tx.Rollback()
				panic(p) // Rollback, then propagate panic
			} else if err != nil {
				tx.Rollback()
			} else {
				err = tx.Commit()
			}
		}()
	}

	primary, err := FindAddress(tx, primaryID)
	if err != nil {
		return errors.Err(err)
	} else if primary == nil {
		return errors.Err("primary Address not found")
	}

	secondary, err := FindAddress(tx, secondaryID)
	if err != nil {
		return errors.Err(err)
	} else if secondary == nil {
		return errors.Err("secondary Address not found")
	}

	foreignKeys := []foreignKey{
		{foreignTable: "input_addresses", foreignColumn: "address_id"},
		{foreignTable: "inputs", foreignColumn: "address_id"},
		{foreignTable: "outputs_addresses", foreignColumn: "address_id"},
		{foreignTable: "transactions_addresses", foreignColumn: "address_id"},
	}

	conflictingKeys := []conflictingUniqueKey{}

	err = mergeModels(tx, primaryID, secondaryID, foreignKeys, conflictingKeys)
	if err != nil {
		return err
	}

	pr := reflect.ValueOf(primary)
	sr := reflect.ValueOf(secondary)
	// for any column thats null on the primary and not null on the secondary, copy from secondary to primary
	for i := 0; i < sr.Elem().NumField(); i++ {
		pf := pr.Elem().Field(i)
		sf := sr.Elem().Field(i)
		if sf.IsValid() {
			if nullable, ok := sf.Interface().(null.Nullable); ok && !nullable.IsNull() && pf.Interface().(null.Nullable).IsNull() {
				pf.Set(sf)
			}
		}
	}

	err = primary.Update(tx)
	if err != nil {
		return err
	}

	err = secondary.Delete(tx)
	if err != nil {
		return err
	}

	return nil
}

// Merge combines two Addresses into one. The primary record will be kept, and the secondary will be deleted.
func MergeAddressesG(primaryID uint64, secondaryID uint64) error {
	return MergeAddresses(boil.GetDB(), primaryID, secondaryID)
}
